import React from 'react';

import './contact.css';

class ContactPage extends React.Component {
    render() {
        return (
            <div className='contact'>
                <div className='container'>
                    <form>
                        <input type='email' placeholder='Email'/>
                        <textarea></textarea>
                    </form>
                </div>
            </div>
        );
    }
}

export default ContactPage;
